import { useCookies } from 'react-cookie';
import { useNavigate } from "react-router-dom";
import { useState } from "react"



export function SingleClient() {

    const [hover, setHover] = useState(false);

    function MouseOver(event) {
        setHover(true)
    }
    function MouseOut(event){
        setHover(false)
    }


      return (
          <tr class="candidates-list"  style={hover ? {...client, ...clientHover} : client} onMouseOver={MouseOver} onMouseOut={MouseOut}>
            <td class="title" style={title}>
              <div class="thumb" style={thumbnail}>
                <img class="img-fluid" src="https://bootdey.com/img/Content/avatar/avatar7.png" alt="" style={thumbnailImage}/>
              </div>
              <div class="candidate-list-details">
                <div class="candidate-list-info">
                  <div class="candidate-list-title">
                    <h5 class="mb-0"><a href="#">Brooke Kelly</a></h5>
                  </div>
                  <div class="candidate-list-option">
                    <ul class="list-unstyled" style={list}>
                      <li style={listItem}><i class="fas fa-filter pr-1"></i>Information Technology</li>
                      <li style={listItem}><i class="fas fa-map-marker-alt pr-1"></i>Rolling Meadows, IL 60008</li>
                    </ul>
                  </div>
                </div>
              </div>
            </td>
            <td class="candidate-list-favourite-time text-center" style={textField}>
              <span class="candidate-list-time order-1" style={textFieldText}>Shortlisted</span>
            </td>
            <td style={actions}>
              <ul class="list-unstyled mb-0 d-flex justify-content-end">
                <li style={actionListItem}><a href="#" class="text-primary" data-toggle="tooltip" title="" data-original-title="view"><i class="far fa-eye"></i></a></li>
                <li style={actionListItem}><a href="#" class="text-info" data-toggle="tooltip" title="" data-original-title="Edit"><i class="fas fa-pencil-alt"></i></a></li>
                <li style={actionListItem}><a href="#" class="text-danger" data-toggle="tooltip" title="" data-original-title="Delete"><i class="far fa-trash-alt"></i></a></li>
              </ul>
            </td>
          </tr>
      );
}


const thumbnail = {
    "margin-right": "25px",
    "-webkit-box-flex": 0,
    "-ms-flex": "0 0 80px",
    "flex": "0 0 80px",
    "border": "none",
}

const thumbnailImage = {
    "width": "80px",
    "height": "80px",
    "-o-object-fit": "cover",
    "object-fit": "cover",
    "overflow": "hidden",
    "border-radius": "50%",
}

const title = {
    "display": "-webkit-box",
    "display": "-ms-flexbox",
    "display": "flex",
    "-webkit-box-align": "center",
    "-ms-flex-align": "center",
    "align-items": "center",
    "padding": "30px 0",
    "vertical-align": "middle",
    "margin-bottom": "5px"
}

const textField = {
    "vertical-align": "middle",
    "margin-left": "auto",
    "text-align": "center",
    "font-size": "13px",
    "-webkit-box-flex": 0,
    "-ms-flex": "0 0 90px",
    "flex": "0 0 90px",
}

const textFieldText = {
    "display": "block",
    "margin": "0 auto"
}

const actions = {
    "vertical-align": "middle"
}

const list = {
    "color": "#969696",
    "display": "-webkit-box",
    "display": "-ms-flexbox",
    "display": "flex",
    "-ms-flex-wrap": "wrap",
    "flex-wrap": "wrap",
    "margin-bottom": "0px",
}

const listItem = {
    "margin": "0 4px",
    "margin": "5px 10px 5px 0px",
    "font-size": "13px"

}

const actionListItem = {
    "margin": "0 4px",

}

const client = {
    "background": "#ffffff",
    //"display": "-webkit-box",
    //"display": "-ms-flexbox",
    //"display": "flex",
    "border-bottom": "1px solid #eeeeee",
    "-webkit-box-align": "center",
    "-ms-flex-align": "center",
    "align-items": "center",
    "padding": "20px",
    "-webkit-transition": "all 0.3s ease-in-out",
    "transition": "all 0.3s ease-in-out",
}

const clientHover = {
    "-webkit-box-shadow": "0px 0px 34px 4px rgba(33, 37, 41, 0.06)",
    "box-shadow": "0px 0px 34px 4px rgba(33, 37, 41, 0.06)",
    "position": "relative",
    "z-index": 99,
}
